import React, { useEffect, useState } from "react";
import axios from "axios";

const User = () => {
  const [users, setUsers] = useState([]);
  useEffect(() => {
    let ignore = false;
    fetchUsers();
    async function fetchUsers() {
      const res = await axios.get(
        "https://64cb8f7f700d50e3c7061cf4.mockapi.io/api/users"
      );
      if (!ignore) {
        setUsers(res.data);
      }
    }
    return () => {
      ignore = true;
    };
  }, []);
  return (
    <div>
      {users.map((item) => {
        return (
          <ul>
            <li>item.name</li>
          </ul>
        );
      })}
    </div>
  );
};

export default User;
